import React, { Component } from 'react';
import Countdown from 'react-countdown-now';
import moment from 'moment';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      days: '',
      hours: '',
      minutes: '',
      seconds: '00',
    }
  }

  getTime = () => {
    const diff = moment("2018-12-22").diff(moment());
    const diffDuration = moment.duration(diff);
    return diffDuration;
  }

  render() {
    return (
      <div className="App">
        <div className="Title">Nedr√§kning till B+B ses i Mumbai!</div>
        <div className="time"></div>
        <Countdown date={this.getTime()} />
      </div>
    );
  }
}

export default App;
